(2000009724, 100036, '2013-09-23 10:49:11', 'FTPs', 200152, 'update', 'product_id:0=>1214'),
(2000009725, 100003, '2013-09-23 11:10:06', 'Tickets', 200057, 'insert', 'id:1000057, created_by:3, created_at:2013-09-23 07:10:06, updated_by:, updated_at:, status:Open, company_id:3, opened_by:3, opened_at:2013-09-23 07:10:06, assigned_to:, assigned_at:, closed_by:, closed_at:, estimate_hour:0.0, worked_hour:0.0, priority:Normal, category:Companies, description:Pat, o cadastro de clientes, em vendas, precisa de mais informaçoes. No caso desse print estou passando a Tela Principal onde o campo que esta marcado como p pode ser TC (Tipo de Cliente) e ficar com numeraçao de 1 a 10 para escolha.\nCheck Box chamado CF (custo financeiro) sim ou nao. Temos um custo básico, que pdoemos colocar no admin, que é de 3% ao mês. Se for marcado não, indiferente da condiçao de pagamento ele ignora os 3% ao mês. Se marcar Sim, abre uma caixa para preenchimento numero 99,99, sempre ao mês. Se nao tiver nada marcado, assume o default do sistema (3% ao mês), caso tenha algo marcado (Exemplo: 2,00) assume 2% ao mês. Continuarei num segundo Report com mesma imagem., resolution:, photo:'),
(2000009726, 100003, '2013-09-23 11:10:14', 'Tickets', 200057, 'update', 'updated_by:=>3, photo:=>CADASTRO DE CLIENTES 01.jpg,2013-09-23 11:10:11,333521'),
(2000009727, 100003, '2013-09-23 11:16:49', 'Tickets', 200058, 'insert', 'id:1000058, created_by:3, created_at:2013-09-23 07:16:49, updated_by:, updated_at:, status:Open, company_id:3, opened_by:3, opened_at:2013-09-23 07:16:49, assigned_to:, assigned_at:, closed_by:, closed_at:, estimate_hour:0.0, worked_hour:0.0, priority:Normal, category:Companies, description:Check box para DM(duplicata). Iremos gerar a duplicata direto do sistema, os bancos mandam os arquivos de como podemos fazer isso, e o Unidanfe também faz a impressão. Caso sim, junto com o romaneio, ja faz as duplicatas de acordo com valor das parcelas e datas.\nComo para escolha de condicao de pagamento (CP) precisamos criar no admin, ou entao um cadastro em planejamento, para condicao de pagamento. EX: a vista, 10 dias, 15/30/45, 20/40, 30, 30/45/60, etc\nCampo chamado de CS para colocarmos o limite do cliente (Esse campo é interessante ter esse nome de cs pois em caso de fiscalizacao podemos falar que é capital social). o Campo é numero até sei digitos mais 2 de virgula 999.999,99 e o ideal é que, a medida que o cliente for comprandoe não tiver passado a data do pagamento ainda, seja indicado na tela se ele esta ultrapassando o limite dele ou nao., resolution:, photo:'),
