(200056, 3, '2013-09-23 06:25:21', 100001, '2013-09-23 16:32:22', 'Closed', 900001, 100003, '2013-09-23 06:25:21', NULL, NULL, 100001, '2013-09-23 20:32:22', '0.0', '0.1', 'Major', 'Companies', 'Pat, na hora de criar um cliente que não é empresa, não consigo salvar porque pde que seja ligado a alguma companhia.', 'my_validate_required(jky-contact-company, Company);', 'Erro_23-09_01.jpg,2013-09-23 10:25:35,344593'),
(200057, 3, '2013-09-23 07:10:06', 100001, '2013-10-19 07:14:18', 'Closed', 900001, 100003, '2013-09-23 07:10:06', NULL, NULL, 100001, '2013-10-19 11:14:18', '0.0', '0.1', 'Normal', 'Companies', 'Pat, o cadastro de clientes, em vendas, precisa de mais informaçoes. No caso desse print estou passando a Tela Principal onde o campo que esta marcado como p pode ser TC (Tipo de Cliente) e ficar com numeraçao de 1 a 10 para escolha.\nCheck Box chamado CF (custo financeiro) sim ou nao. Temos um custo básico, que pdoemos colocar no admin, que é de 3% ao mês. Se for marcado não, indiferente da condiçao de pagamento ele ignora os 3% ao mês. Se marcar Sim, abre uma caixa para preenchimento numero 99,99, sempre ao mês. Se nao tiver nada marcado, assume o default do sistema (3% ao mês), caso tenha algo marcado (Exemplo: 2,00) assume 2% ao mês. Continuarei num segundo Report com mesma imagem.', '', 'CADASTRO DE CLIENTES 01.jpg,2013-09-23 11:10:11,333521'),
(200058, 3, '2013-09-23 07:16:49', 100001, '2013-10-19 07:14:11', 'Closed', 900001, 100003, '2013-09-23 07:16:49', NULL, NULL, 100001, '2013-10-19 11:14:11', '0.0', '0.1', 'Normal', 'Companies', 'Check box para DM(duplicata). Iremos gerar a duplicata direto do sistema, os bancos mandam os arquivos de como podemos fazer isso, e o Unidanfe também faz a impressão. Caso sim, junto com o romaneio, ja faz as duplicatas de acordo com valor das parcelas e datas.\nComo para escolha de condicao de pagamento (CP) precisamos criar no admin, ou entao um cadastro em planejamento, para condicao de pagamento. EX: a vista, 10 dias, 15/30/45, 20/40, 30, 30/45/60, etc\nCampo chamado de CS para colocarmos o limite do cliente (Esse campo é interessante ter esse nome de cs pois em caso de fiscalizacao podemos falar que é capital social). o Campo é numero até sei digitos mais 2 de virgula 999.999,99 e o ideal é que, a medida que o cliente for comprandoe não tiver passado a data do pagamento ainda, seja indicado na tela se ele esta ultrapassando o limite dele ou nao.', '', 'CADASTRO DE CLIENTES 01.jpg,2013-09-23 11:16:54,333521'),
(200059, 3, '2013-09-23 09:26:17', 100001, '2013-09-23 16:26:55', 'Closed', 900001, 100003, '2013-09-23 09:26:17', NULL, NULL, 100001, '2013-09-23 20:26:55', '0.0', '0.5', 'Critical', 'FTPs', 'As FTPs 146 e 150 estao saindo em 3 páginas. Acredito que esta acontecendo alguma falha na ordem de impressao, pois tem um desenho tecnico e uma das páginas esta saindo com ele.', 'as images foram retiradas da impressao', NULL),
